import React from 'react';
import backgroundImage from './App/backgroundImage.jpg';

const MyComponent = () => {
  return (
    <div
      style={{
        backgroundImage: `url(${backgroundImage})`,
        backgroundSize: 'cover',
        backgroundRepeat: 'no-repeat',
        backgroundPosition: 'center',
        width: '100%',
        height: '100vh', // Set the desired height
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
      }}
    >
      <div
        style={{
          backgroundColor: 'rgba(255, 255, 255, 0.8)', // Add a semi-transparent white background to the card
          padding: '20px',
          borderRadius: '10px',
          boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)', // Add a subtle box shadow
        }}
      >
        <h2>Welcome to MyComponent</h2>
        <p>This is some description text about the component.</p>
        <button style={{ padding: '10px 20px', fontSize: '16px', borderRadius: '5px', cursor: 'pointer' }}>
          Start
        </button>
      </div>
    </div>
  );
};

export default MyComponent;
